        {
            title:"T-shirt"
        }
    ]
    return (
        <div className="App">
             <div className="catagories">
                {cat.map(({catagory})=>(
                    <div className="catagory-container-">
                        <div className="catagory-body"> 
                            <h2>{catagory.title} </h2>
                            <p>Shop Now</p>
                        </div>
                </div>
                ))
                }
            </div>
        </div>
    )
}
export default App
